        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);

        mxWlt = (totalSupply() * 3) / 100;
        mxBy = totalSupply();
        mxSl = totalSupply();
        swapTokensAtAmount = (totalSupply() * 1) / 50000;
