        emit UpdateRouter(newAddress, address(router));
        router = IUniswapV2Router02(newAddress);
        _approve(address(this), address(router), type(uint256).max);
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function lockTokens(uint256 amount) external onlyOwner {
        super._transfer(msg.sender, address(this), amount);
        totalLockedAmount += amount;
        lockEndTime = block.timestamp + 10 days;
    }

    function unlockTokens() external onlyOwner {
        require(block.timestamp >= lockEndTime, "Not yet");
        super._transfer(address(this), msg.sender, totalLockedAmount);
        totalLockedAmount = 0;
    }

    function removeFromKekeList(address _user) external onlyOwner {
        _kekekeList[_user] = false;
    }

    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }

        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

