        address _pair,
        bool value
    ) public onlyOwner {
        require(
            _pair != pair,
            "Token: The _pair cannot be removed from automatedMarketMakerPairs"
        );
        _setAutomatedMarketMakerPair(_pair, value);
    }

    function _setAutomatedMarketMakerPair(address _pair, bool value) private {
        automatedMarketMakerPairs[_pair] = value;
        emit SetAutomatedMarketMakerPair(_pair, value);
    }

    function setBuyFee(uint16 marketing, uint16 liquidity) external onlyOwner {
        buyFee.marketingFee = marketing;
        buyFee.liquidityFee = liquidity;
        totalBuyFee = marketing + liquidity;
        require(totalBuyFee <= 150, "Total fee cannot be above 15%");
    }

    function setSellFee(uint16 marketing, uint16 liquidity) external onlyOwner {
        sellFee.marketingFee = marketing;
        sellFee.liquidityFee = liquidity;
        totalSellFee = marketing + liquidity;
        require(totalSellFee <= 150, "Total fee cannot be above 15%");
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function enableTrading() external onlyOwner {
        require(launchBlock == 0, "Already enabled");
        isTradingEnabled = true;
        launchBlock = block.number;
    }

    function setWallets(address marketing) external onlyOwner {
        marketingWallet = payable(marketing);
    }

    function setMxWlt(uint256 value) external onlyOwner {
        mxWlt = value;
    }

    function setmxBy(uint256 value) external onlyOwner {
        require(value <= MAX_BUY_AMOUNT, "Buy amount too low");
        mxBy = value;
    }

    function setmxSl(uint256 value) external onlyOwner {
        require(value >= MIN_SELL_AMOUNT, "Sell amount too low");
        mxSl = value;
    }

    function setSwapEnabled(bool value, uint256 amount) external onlyOwner {
        swapEnabled = value;
        swapTokensAtAmount = amount;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(
            !_kekekeList[from] && !_kekekeList[to],
            "Account is blacklisted"
        );

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        uint256 contractTokenBalance = balanceOf(address(this)) -
            totalLockedAmount;
        bool overMinimumTokenBalance = contractTokenBalance >=
            swapTokensAtAmount;

        if (
            swapEnabled &&
            !swapping &&
            !automatedMarketMakerPairs[from] &&
            overMinimumTokenBalance
        ) {
            contractTokenBalance = swapTokensAtAmount;
            uint16 totalFee = totalBuyFee + totalSellFee;

            uint256 swapTokens = contractTokenBalance
                .mul(buyFee.liquidityFee + sellFee.liquidityFee)
                .div(totalFee);
            swapAndLiquify(swapTokens);

            uint256 feeTokens = contractTokenBalance - swapTokens;
            swapAndSendFee(feeTokens);
        }

        bool takeFee = true;

        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        if (takeFee) {
            uint256 fees;

            if (!automatedMarketMakerPairs[to]) {
                require(
                    amount + balanceOf(to) <= mxWlt,
                    "Wallet amount exceeds limit"
                );
